# method 2
compl = {'A':'T','T':'A','C':'G','G':'C'}
TEXT = 'TCAGTAC'

def reverser(text):
    x = ''
    for i in range(len(text)):
        x += compl[text[len(text) - i - 1]]
    return x

print(reverser(TEXT))